import React from "react";
import CryptoDashboard from "./pages/CryptoDashboard";
import { Toaster } from "./components/ui/toaster";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Wallet from "./components/ui/wallet";

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<CryptoDashboard />} />
        <Route path="/dashboard" element={<CryptoDashboard />} />
        <Route path="/crypto/:id" element={<CryptoDashboard />} />
        <Route path="/crypto/:id/details" element={<CryptoDashboard />} />
        <Route path="/crypto/:id/overview" element={<CryptoDashboard />} />
        <Route path="/crypto/:id/price" element={<CryptoDashboard />} />
        <Route path="/crypto/:id/market" element={<CryptoDashboard />} />
        <Route path="/crypto/:id/transactions" element={<CryptoDashboard />} />
        <Route path="/crypto/:id/portfolio" element={<CryptoDashboard />} />
        <Route path="/wallet" element={<Wallet />} />
        <Route path="/wallet/:id" element={<Wallet />} />
        <Route path="/wallet/:id/details" element={<Wallet />} />
        </Routes>
      <Toaster position="top-right" reverseOrder={false} />
    </Router>
  );
};

export default App;
